import React, { Component } from 'react';
import Regular from './Regular.js'

var fontColor = 'black';
var bgColor = 'white';
class App extends Component {
    FrogMode = () => {
        console.log("frog");
        fontColor = 'green';
        bgColor = 'green';
    }

    render() {
        return (
            <div className="App">
                <button className="button" onClick={this.FrogMode}>Frog Mode</button>
                <Regular bg={this.bgColor} font={this.fontColor}></Regular>
            </div>
        );
    }
}

export default App;
